import classes from "./Block5.module.css";
import Item from "./Items/Item";
import React from "react";

let Block5 = (props) => {
    let item2 = props.r[0].item2;
    let item3 = props.r[0].item3;
    let item4 = props.r[0].item4;
    let item5 = props.r[0].item5;
    let item6 = props.r[0].item6;
    let item7 = props.r[0].item7;


    //console.log(props.re[0].item1.icon);
    return(
        <div className={classes.block}>
            <h2>process we follow</h2>
            <div className={classes.blockFlex}>
                <Item number={props.r[0].item1.number} icon={props.r[0].item1.icon} title={props.r[0].item1.title}  text={props.r[0].item1.text}/>
                <Item number={item2.number} icon={item2.icon} title={item2.title}  text={item2.text}/>
                <Item number={item3.number} icon={item3.icon} title={item3.title}  text={item3.text}/>
                <Item number={item4.number} icon={item4.icon} title={item4.text1}  text={item4.text}/>
                <Item number={item5.number} icon={item5.icon} title={item5.text1}  text={item5.text}/>
                <Item number={item6.number} icon={item6.icon} title={item6.text1}  text={item6.text}/>
                <Item number={item7.number} icon={item7.icon} title={item7.text1}  text={item6.text}/>

            </div>

        </div>
    );
};
export default Block5;
